import React, { Component } from 'react';
import ColorBox from './ColorBox'
class Palette extends Component {
    render() {

        const colorBox = this.props.colors.map(color => (
            <ColorBox background={color.color}/>
        ))
        return (
            <div>
                {colorBox}
            </div>
        )   
    }
}


export default Palette;





